import './User.css'
function User(){
    let login = window.location.search === '?register';
    return(
        <div className='content_block'>
            <div className="content_block" id="header_block">
                <header className='user_header'>
                    <div className='register_label'>Register</div>
                    <div>|</div>
                    <div className='login_label'>Register</div>
                </header>
            </div>
        </div>
    );
}

export default User;
